import React from 'react';

function Portfolio() {
  const navbarStyle = {
    backgroundColor: '#6a1b9a', // Cor de fundo roxa
    color: 'white', // Cor do texto branco
    display: 'flex',
    justifyContent: 'space-around',
    padding: '10px 0',
  };

  const linkStyle = {
    textDecoration: 'none',
    color: 'white',
    fontWeight: 'bold',
  };

  return (
    <div>
      <div style={navbarStyle}>
        <a href="#" style={linkStyle}>
          Hi World
        </a>
        <a href="#" style={linkStyle}>
          Quem sou eu
        </a>
        <a href="#" style={linkStyle}>
          Conhecimentos
        </a>
        <a href="#" style={linkStyle}>
          Projetos
        </a>
        <a href="#" style={linkStyle}>
          Redes
        </a>
      </div>
    </div>
  );
}

export default Portfolio;
